Description:
&quot;The legends were true. King Arthur&amp;#039;s Camelot was every bit as wondrous as the tales it inspired... and its fall every bit as bleak. After Arthur&amp;#039;s death, his sister Morgen, Queen of the fey, took Camelot for her own. By her side stands a new dark Pendragon known only as the Kerrigan. with his help, Morgen rules over all the dark lands. In opposition to them is Merlin and the remnants of Arthur&amp;#039;s Knights, no known as the Lords of Avalon. Rumors foretell the coming of the next Merlin, and both sides race to find its origins, leading them to the most unlikely of place: a simple peasant girl.&quot;
